      flexDirection: "column",
      with:300,
      transform:"translate(50%,50%)" }}>
        <div>
          <label>Correo Electrónico</label>
          <input />
        </div>
        <div>
          <label>Contraseña </label>
          <input />
        </div>
        <button>Iniciar Sesión</button>
      </div>
    );
}

